                <img src ='https://yandex.by/images/search?text=enjxrf&from=tabbar&pos=0&img_url=https%3A%2F%2Favatars.mds.yandex.net%2Fget-marketpic%2F203633%2Fmarket_PC0PmWwBWyUiPBI_oIzMEw%2Forig&rpt=simage' />
                Post
            </div>
        </div>

    )
}
export default Post;
